Episode Title: &quot;Murder and Medical Malpractice; Debt and Deployment&quot;
Episode Order: Season 18, Episode 95
Original Air Date: December 10, 2013

&quot;Birth-control complications, an arrest for failure to pay child support and a car connected to a murder come into play; a military wife invites a troubled friend to live with her, then sues her for loans to pay her rent and expenses.&quot;

Seed and enjoy!
